import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question({getquestionid, id}) {



    const q = getquestionid(id);

    return(
        <Paper>
            <h1>Question Details</h1>
            <p></p>
            <p>{q.title}</p>       
        </Paper>
    )
}

export default Question;
